    "Enter the enrollment code.": "\u0412\u0432\u0435\u0434\u0438\u0442\u0435 \u043a\u043e\u0434 \u0437\u0430\u0447\u0438\u0441\u043b\u0435\u043d\u0438\u044f.", 
