    "No results found for {original_query}. Showing results for {suggested_query}.": "\u041d\u0435\u0442 \u0440\u0435\u0437\u0443\u043b\u044c\u0442\u0430\u0442\u043e\u0432 \u043a \u0437\u0430\u043f\u0440\u043e\u0441\u0443 {original_query}. \u041f\u043e\u043a\u0430\u0437\u044b\u0432\u0430\u0435\u043c \u0440\u0435\u0437\u0443\u043b\u044c\u0442\u0430\u0442\u044b \u043a {suggested_query}.", 
